subroutine p_force(rate_constant, number_density, number_density_air, force)
  ! Compute force function for all molecules

  real(r8), intent(in) :: rate_constant(:)
  real(r8), intent(in) :: number_density(:)
  real(r8), intent(in) :: number_density_air
  real(r8), intent(out) :: force(:)



! XYLOLOOH
  force(1) = 0

  ! k_HO2_XYLOLO2_1: HO2 + XYLOLO2 -> 1*XYLOLOOH
  force(1) = force(1) + rate_constant(278) * number_density(107) * number_density(7)

  ! k_OH_XYLOLOOH_1: OH + XYLOLOOH -> 1*XYLOLO2
  force(1) = force(1) - rate_constant(281) * number_density(148) * number_density(1)

  ! j_XYLOLOOH_1: XYLOLOOH -> 1*OH + 0.17*GLYOXAL + 0.51*CH3COCHO + 1*HO2
  force(1) = force(1) - rate_constant(344) * number_density(1)


! XYLOL
  force(2) = 0

  ! k_OH_XYLENES_1: OH + XYLENES -> 0.15*XYLOL + 0.23*TEPOMUC + 0.06*BZOO + 0.56*XYLENO2 + 0.38*HO2
  force(2) = force(2) + 0.15*rate_constant(274) * number_density(148) * number_density(4)

  ! k_OH_XYLOL_1: OH + XYLOL -> 0.3*XYLOLO2 + 0.63*HO2 + 0.07*PHENO
  force(2) = force(2) - rate_constant(280) * number_density(148) * number_density(2)


! ACBZO2
  force(3) = 0

  ! k_ACBZO2_HO2_1: ACBZO2 + HO2 -> 0.4*C6H5O2 + 0.4*OH
  force(3) = force(3) - rate_constant(1) * number_density(3) * number_density(107)

  ! k_ACBZO2_NO_1: ACBZO2 + NO -> 1*C6H5O2 + 1*NO2
  force(3) = force(3) - rate_constant(2) * number_density(3) * number_density(106)

  ! k_BZALD_OH_1: BZALD + OH -> 1*ACBZO2
  force(3) = force(3) + rate_constant(24) * number_density(45) * number_density(148)

  ! k_ACBZO2_NO2_M_1: M, ACBZO2 + NO2 -> 1*PBZNIT
  force(3) = force(3) - rate_constant(218) * number_density(3) * number_density(147) * number_density_air

  ! k_PBZNIT_M_1: M, PBZNIT -> 1*ACBZO2 + 1*NO2
  force(3) = force(3) + rate_constant(265) * number_density(118) * number_density_air


! XYLENES
  force(4) = 0

  ! k_OH_XYLENES_1: OH + XYLENES -> 0.15*XYLOL + 0.23*TEPOMUC + 0.06*BZOO + 0.56*XYLENO2 + 0.38*HO2
  force(4) = force(4) - rate_constant(274) * number_density(148) * number_density(4)


! ALKO2
  force(5) = 0

  ! k_ALKO2_HO2_1: ALKO2 + HO2 -> 1*ALKOOH
  force(5) = force(5) - rate_constant(4) * number_density(5) * number_density(107)

  ! k_ALKO2_NO_1: ALKO2 + NO -> 0.4*CH3CHO + 0.1*CH2O + 0.25*CH3COCH3 + 1*HO2 + 0.8*MEK + 1*NO2
  force(5) = force(5) - rate_constant(5) * number_density(5) * number_density(106)

  ! k_ALKO2_NO_2: ALKO2 + NO -> 1*ALKNIT
  force(5) = force(5) - rate_constant(6) * number_density(5) * number_density(106)

  ! k_ALKOOH_OH_1: ALKOOH + OH -> 1*ALKO2
  force(5) = force(5) + rate_constant(7) * number_density(63) * number_density(148)

  ! k_BIGALK_OH_1: BIGALK + OH -> 1*ALKO2
  force(5) = force(5) + rate_constant(18) * number_density(25) * number_density(148)


! Ar
  force(6) = 0


! XYLOLO2
  force(7) = 0

  ! k_HO2_XYLOLO2_1: HO2 + XYLOLO2 -> 1*XYLOLOOH
  force(7) = force(7) - rate_constant(278) * number_density(107) * number_density(7)

  ! k_NO_XYLOLO2_1: NO + XYLOLO2 -> 1*HO2 + 1*NO2 + 0.17*GLYOXAL + 0.51*CH3COCHO
  force(7) = force(7) - rate_constant(279) * number_density(106) * number_density(7)

  ! k_OH_XYLOL_1: OH + XYLOL -> 0.3*XYLOLO2 + 0.63*HO2 + 0.07*PHENO
  force(7) = force(7) + 0.3*rate_constant(280) * number_density(148) * number_density(2)

  ! k_OH_XYLOLOOH_1: OH + XYLOLOOH -> 1*XYLOLO2
  force(7) = force(7) + rate_constant(281) * number_density(148) * number_density(1)


! SOAG0
  force(8) = 0

  ! k_GLYOXAL_1: GLYOXAL -> 1*SOAG0
  force(8) = force(8) + rate_constant(244) * number_density(59)


! XYLENOOH
  force(9) = 0

  ! k_HO2_XYLENO2_1: HO2 + XYLENO2 -> 1*XYLENOOH
  force(9) = force(9) + rate_constant(275) * number_density(107) * number_density(33)

  ! k_OH_XYLENOOH_1: OH + XYLENOOH -> 1*XYLENO2
  force(9) = force(9) - rate_constant(277) * number_density(148) * number_density(9)

  ! j_XYLENOOH_1: XYLENOOH -> 1*OH + 1*HO2 + 0.34*GLYOXAL + 0.54*CH3COCHO + 0.06*BIGALD1 + 0.2*BIGALD2 + 0.15*BIGALD3 + 0.21*BIGALD4
  force(9) = force(9) - rate_constant(343) * number_density(9)


! XOOH
  force(10) = 0

  ! k_HO2_XO2_1: HO2 + XO2 -> 1*XOOH
  force(10) = force(10) + rate_constant(270) * number_density(107) * number_density(141)

  ! k_OH_XOOH_1: OH + XOOH -> 0.5*XO2 + 0.5*OH
  force(10) = force(10) - rate_constant(273) * number_density(148) * number_density(10)

  ! j_XOOH_1: XOOH -> 1*OH
  force(10) = force(10) - rate_constant(342) * number_density(10)


! BENZENE
  force(11) = 0

  ! k_BENZENE_OH_1: BENZENE + OH -> 0.53*PHENOL + 0.12*BEPOMUC + 0.65*HO2 + 0.35*BENZO2
  force(11) = force(11) - rate_constant(14) * number_density(11) * number_density(148)


! BENZO2
  force(12) = 0

  ! k_BENZENE_OH_1: BENZENE + OH -> 0.53*PHENOL + 0.12*BEPOMUC + 0.65*HO2 + 0.35*BENZO2
  force(12) = force(12) + 0.35*rate_constant(14) * number_density(11) * number_density(148)

  ! k_BENZO2_HO2_1: BENZO2 + HO2 -> 1*BENZOOH
  force(12) = force(12) - rate_constant(15) * number_density(12) * number_density(107)

  ! k_BENZO2_NO_1: BENZO2 + NO -> 1*NO2 + 1*GLYOXAL + 0.5*BIGALD1 + 1*HO2
  force(12) = force(12) - rate_constant(16) * number_density(12) * number_density(106)

  ! k_BENZOOH_OH_1: BENZOOH + OH -> 1*BENZO2
  force(12) = force(12) + rate_constant(17) * number_density(15) * number_density(148)


! TOLUENE
  force(13) = 0

  ! k_OH_TOLUENE_1: OH + TOLUENE -> 0.18*CRESOL + 0.1*TEPOMUC + 0.07*BZOO + 0.65*TOLO2 + 0.28*HO2
  force(13) = force(13) - rate_constant(240) * number_density(148) * number_density(13)


! TEPOMUC
  force(14) = 0

  ! k_OH_TOLUENE_1: OH + TOLUENE -> 0.18*CRESOL + 0.1*TEPOMUC + 0.07*BZOO + 0.65*TOLO2 + 0.28*HO2
  force(14) = force(14) + 0.1*rate_constant(240) * number_density(148) * number_density(13)

  ! k_OH_XYLENES_1: OH + XYLENES -> 0.15*XYLOL + 0.23*TEPOMUC + 0.06*BZOO + 0.56*XYLENO2 + 0.38*HO2
  force(14) = force(14) + 0.23*rate_constant(274) * number_density(148) * number_density(4)

  ! j_TEPOMUC_1: TEPOMUC -> 0.5*CH3CO3 + 1*HO2 + 1.5*CO
  force(14) = force(14) - rate_constant(335) * number_density(14)


! BENZOOH
  force(15) = 0

  ! k_BENZO2_HO2_1: BENZO2 + HO2 -> 1*BENZOOH
  force(15) = force(15) + rate_constant(15) * number_density(12) * number_density(107)

  ! k_BENZOOH_OH_1: BENZOOH + OH -> 1*BENZO2
  force(15) = force(15) - rate_constant(17) * number_density(15) * number_density(148)

  ! j_BENZOOH_1: BENZOOH -> 1*OH + 1*GLYOXAL + 0.5*BIGALD1 + 1*HO2
  force(15) = force(15) - rate_constant(284) * number_density(15)


! BIGALD1
  force(16) = 0

  ! k_BENZO2_NO_1: BENZO2 + NO -> 1*NO2 + 1*GLYOXAL + 0.5*BIGALD1 + 1*HO2
  force(16) = force(16) + 0.5*rate_constant(16) * number_density(12) * number_density(106)

  ! k_NO_TOLO2_1: NO + TOLO2 -> 1*NO2 + 0.6*GLYOXAL + 0.4*CH3COCHO + 1*HO2 + 0.2*BIGALD1 + 0.2*BIGALD2 + 0.2*BIGALD3
  force(16) = force(16) + 0.2*rate_constant(238) * number_density(106) * number_density(53)

  ! k_NO_XYLENO2_1: NO + XYLENO2 -> 1*NO2 + 1*HO2 + 0.34*GLYOXAL + 0.54*CH3COCHO + 0.06*BIGALD1 + 0.2*BIGALD2 + 0.15*BIGALD3 + 0.21*BIGALD4
  force(16) = force(16) + 0.06*rate_constant(276) * number_density(106) * number_density(33)

  ! j_BENZOOH_1: BENZOOH -> 1*OH + 1*GLYOXAL + 0.5*BIGALD1 + 1*HO2
  force(16) = force(16) + 0.5*rate_constant(284) * number_density(15)

  ! j_BEPOMUC_1: BEPOMUC -> 1*BIGALD1 + 1.5*HO2 + 1.5*CO
  force(16) = force(16) + rate_constant(285) * number_density(22)

  ! j_BIGALD1_1: BIGALD1 -> 0.6*MALO2 + 1*HO2
  force(16) = force(16) - rate_constant(287) * number_density(16)

  ! j_TOLOOH_1: TOLOOH -> 1*OH + 0.6*GLYOXAL + 0.4*CH3COCHO + 1*HO2 + 0.2*BIGALD1 + 0.2*BIGALD2 + 0.2*BIGALD3
  force(16) = force(16) + 0.2*rate_constant(341) * number_density(50)

  ! j_XYLENOOH_1: XYLENOOH -> 1*OH + 1*HO2 + 0.34*GLYOXAL + 0.54*CH3COCHO + 0.06*BIGALD1 + 0.2*BIGALD2 + 0.15*BIGALD3 + 0.21*BIGALD4
  force(16) = force(16) + 0.06*rate_constant(343) * number_density(9)


! APIN
  force(17) = 0

  ! k_APIN_NO3_1: APIN + NO3 -> 1*NTERPO2
  force(17) = force(17) - rate_constant(8) * number_density(17) * number_density(115)

  ! k_APIN_O3_1: APIN + O3 -> 0.33*TERPROD1 + 0.3*TERPROD2 + 0.63*OH + 0.57*HO2 + 0.23*CO + 0.27*CO2 + 0.52*CH3COCH3 + 0.34*CH2O + 0.1*BIGALD + 0.05*HCOOH + 0.05*BIGALK + 0.06*CH3CO3 + 0.06*RO2
  force(17) = force(17) - rate_constant(9) * number_density(17) * number_density(121)

  ! k_APIN_OH_1: APIN + OH -> 1*TERPO2
  force(17) = force(17) - rate_constant(10) * number_density(17) * number_density(148)


! BIGALD2
  force(18) = 0

  ! k_NO_TOLO2_1: NO + TOLO2 -> 1*NO2 + 0.6*GLYOXAL + 0.4*CH3COCHO + 1*HO2 + 0.2*BIGALD1 + 0.2*BIGALD2 + 0.2*BIGALD3
  force(18) = force(18) + 0.2*rate_constant(238) * number_density(106) * number_density(53)

  ! k_NO_XYLENO2_1: NO + XYLENO2 -> 1*NO2 + 1*HO2 + 0.34*GLYOXAL + 0.54*CH3COCHO + 0.06*BIGALD1 + 0.2*BIGALD2 + 0.15*BIGALD3 + 0.21*BIGALD4
  force(18) = force(18) + 0.2*rate_constant(276) * number_density(106) * number_density(33)

  ! j_BIGALD2_1: BIGALD2 -> 0.6*HO2 + 0.6*DICARBO2
  force(18) = force(18) - rate_constant(288) * number_density(18)

  ! j_TOLOOH_1: TOLOOH -> 1*OH + 0.6*GLYOXAL + 0.4*CH3COCHO + 1*HO2 + 0.2*BIGALD1 + 0.2*BIGALD2 + 0.2*BIGALD3
  force(18) = force(18) + 0.2*rate_constant(341) * number_density(50)

  ! j_XYLENOOH_1: XYLENOOH -> 1*OH + 1*HO2 + 0.34*GLYOXAL + 0.54*CH3COCHO + 0.06*BIGALD1 + 0.2*BIGALD2 + 0.15*BIGALD3 + 0.21*BIGALD4
  force(18) = force(18) + 0.2*rate_constant(343) * number_density(9)


! ALKNIT
  force(19) = 0

  ! k_ALKNIT_OH_1: ALKNIT + OH -> 0.4*CH2O + 0.8*CH3CHO + 0.8*CH3COCH3 + 1*NO2
  force(19) = force(19) - rate_constant(3) * number_density(19) * number_density(148)

  ! k_ALKO2_NO_2: ALKO2 + NO -> 1*ALKNIT
  force(19) = force(19) + rate_constant(6) * number_density(5) * number_density(106)

  ! j_ALKNIT_1: ALKNIT -> 1*NO2 + 0.4*CH3CHO + 0.1*CH2O + 0.25*CH3COCH3 + 1*HO2 + 0.8*MEK
  force(19) = force(19) - rate_constant(282) * number_density(19)


! BIGALD4
  force(20) = 0

  ! k_NO_XYLENO2_1: NO + XYLENO2 -> 1*NO2 + 1*HO2 + 0.34*GLYOXAL + 0.54*CH3COCHO + 0.06*BIGALD1 + 0.2*BIGALD2 + 0.15*BIGALD3 + 0.21*BIGALD4
  force(20) = force(20) + 0.21*rate_constant(276) * number_density(106) * number_density(33)

  ! j_BIGALD4_1: BIGALD4 -> 1*HO2 + 1*CO + 1*CH3COCHO + 1*CH3CO3
  force(20) = force(20) - rate_constant(290) * number_density(20)

  ! j_XYLENOOH_1: XYLENOOH -> 1*OH + 1*HO2 + 0.34*GLYOXAL + 0.54*CH3COCHO + 0.06*BIGALD1 + 0.2*BIGALD2 + 0.15*BIGALD3 + 0.21*BIGALD4
  force(20) = force(20) + 0.21*rate_constant(343) * number_density(9)


! TERPOOH
  force(21) = 0

  ! k_HO2_TERPO2_1: HO2 + TERPO2 -> 1*TERPOOH
  force(21) = force(21) + rate_constant(231) * number_density(107) * number_density(134)

  ! k_OH_TERPOOH_1: OH + TERPOOH -> 1*TERPO2
  force(21) = force(21) - rate_constant(233) * number_density(148) * number_density(21)

  ! j_TERPOOH_1: TERPOOH -> 0.4*CH2O + 0.05*CH3COCH3 + 1*TERPROD1 + 1*HO2 + 1*OH
  force(21) = force(21) - rate_constant(338) * number_density(21)


! BEPOMUC
  force(22) = 0

  ! k_BENZENE_OH_1: BENZENE + OH -> 0.53*PHENOL + 0.12*BEPOMUC + 0.65*HO2 + 0.35*BENZO2
  force(22) = force(22) + 0.12*rate_constant(14) * number_density(11) * number_density(148)

  ! j_BEPOMUC_1: BEPOMUC -> 1*BIGALD1 + 1.5*HO2 + 1.5*CO
  force(22) = force(22) - rate_constant(285) * number_density(22)


! SO4
